$(document).ready(function(){var o=$("#product-template").html(),c=$("#cart-template").html(),r=Handlebars.compile(o),t=Handlebars.compile(c);$.ajax("/products").done(function(o){$("#product-listing").html(r({products:o})),console.log("success-prod",o,o[0])}).fail(function(){console.log("error-cart")}),$.ajax("/cart_order").done(function(o){$("#product-cart").html(t({cart_order:o})),console.log("success-cart",o)}).fail(function(){console.log("error-cart")})});